import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Form } from "react-bootstrap";
import GoogleLogin from "react-google-login";
import google from "../../assets/icons/google.svg";

class SignUn extends Component {
  constructor(props) {
    super(props);
    this.state = {
      first_name: "",
      last_name: "",
      email: "",
    };
  }
  async responseGoogle(response) {
    console.log(response);
    console.log(response.profileObj);
    if (response.profileObj) {
      const { givenName, familyName, email, googleId } = response.profileObj;
      console.log(givenName, familyName, email, googleId);
    }
  }
  render() {
    return (
      <Container>
        <Row className="justify-content-md-center">
          <Col>
            <Form>
              <Form.Group
                controlId="formBasicPassword"
                style={{
                  fontFamily: "GothamBook",
                  fontSize: "13px",
                  display: "flex",
                  justifyContent: "center",
                  padding: "50px 20px",
                }}
              >
                <GoogleLogin
                  clientId="268029895097-ena92hfakj1dvi8ng9uagllejjfo90b7.apps.googleusercontent.com"
                  buttonText="Google"
                  width="50px"
                  onSuccess={this.responseGoogle.bind}
                  onFailure={this.responseGoogle.bind}
                  cookiePolicy={"single_host_origin"}
                />
                {/* onClick={signIn} */}
                <Button className="google">
                  <img src={google} className="icon"></img>

                  <span style={{ fontFamily: "GothamBook" }}>Google</span>
                </Button>
              </Form.Group>
              <Form.Group controlId="">
                <Form.Control
                  style={{
                    fontFamily: "GothamBook",
                    fontSize: "13px",
                  }}
                  placeholder="Ingresa tus nombres"
                />
              </Form.Group>
              <Form.Group controlId="">
                <Form.Control
                  style={{
                    fontFamily: "GothamBook",
                    fontSize: "13px",
                  }}
                  placeholder="Ingresa tus apellidos"
                />
              </Form.Group>
              <Form.Group controlId="formBasicEmail">
                <Form.Control
                  style={{
                    fontFamily: "GothamBook",
                    fontSize: "13px",
                  }}
                  type="email"
                  placeholder="Correo electronico"
                />
              </Form.Group>
              <Form.Group controlId="formBasicPassword">
                <Form.Control
                  style={{
                    fontFamily: "GothamBook",
                    fontSize: "13px",
                  }}
                  type="password"
                  placeholder="Contraseña"
                />
              </Form.Group>
            </Form>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default SignUn;
